import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Button, Container, Form, FormGroup, Label, Input, Row, Col } from 'reactstrap';
import BusinessCard from './BusinessCard';
import './App.css';

function BusinessListing(props) {

  useEffect(() => {
    console.log("BUSINESSES CHANGED");
  }, [props.businessesFound]);

  return (
    <Container className="listing">
      <Row>
        <Col>
          <h4>____ Restaurants near ____</h4>
          <p>Results displayed: {props.businessesFound}</p>
        </Col>
      </Row>
      <Container className="bizList">
          {props.renderBusinesses}
      </Container>
    </Container>
  );
}

export default BusinessListing;
